import React from "react";
import './cart.css'

const Cart = ({ state, dispatch }) => {
  const {cart}= state;
  // console.log("nwe",cart)
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        margin: 10,
        backgroundColor: "#ececec",
        padding: 10,
        width: "20%",
        borderradius: "2px"
      }}
    >
      <b style={{ fontSize: 30, alignSelf: "center" }}>Cart</b>
    </div>
  );
};

export default Cart;
